 @Marcelo-ve7dd  a diferença é que michael tem garra, convicção e vontade braba de jogar, ele só não tem muita técnica, e ainda somado pelo fato de que ele tem poucos momentos para brilhar durante os jogos, é difícil pra ele, não é acostumado a finalizar, e sempre tenta o menos viável, mas mesmo assim consegue jogar

Vitinho por outro lado alem de não ter garra nem nada, é preguiçoso, não joga direito, parece um rato morto, é arrogante demais pros outros pela própria merda que faz, é impossível gostar do vitinho, impossível

Michael é muito melhor que vitinho e sempre foi, se ele tivesse mais técnica e mais precisão das habilidades em campo, alem de ter mais espaço pra ele jogar, eu tenho certeza que ele iria brilhar por vários jogos, só tem que parar de ser um pouco fominha tbm

